import { Card, CardMedia, makeStyles } from '@mui/material';

const useStyles = makeStyles({
  card: {
    maxWidth: 300,
  },
  media: {
    height: 200,
  },
});

const ImageCard = () => {
  const classes = useStyles();

  return (
    <Card className={classes.card}>
      <CardMedia
        className={classes.media}
        component="img"
        src="data:image/png;base64,"
        alt="Base64 Image"
      />
    </Card>
  );
};

export default ImageCard;
